function sendPacketString(string, size){
    var packet= [];
    var data = string.split(' ');
    
    for(let i = 0; i < data.length; i++){
        packet[parseInt(i,16)] = parseInt(data[i],16)//.toString(16)
    }

    device.write(packet, size);
}

function setDpi(dpi){

    savedDpi1 = dpi;
    var packet = [];
    packet[0] = 0x00;
    packet[1] = 0xD3;
    packet[2] = 0x02;
    packet[3] = 0x00;
    packet[4] = 0x02;
    packet[5] = Math.round(dpi/50);
    device.write(packet, 65);
}
function hexToRgb(hex) {
    var result = /^#?([a-f\d]{2})([a-f\d]{2})([a-f\d]{2})$/i.exec(hex);
    var colors = [];
    colors[0] = parseInt(result[1], 16);
    colors[1] = parseInt(result[2], 16);
    colors[2] = parseInt(result[3], 16);

    return colors;
}
export function Shutdown()
{
    sendColors(16,true);
    sendColors(0,true);
}

export function Validate(endpoint)
{
    return endpoint.interface === 1
}
function sendColors(zoneId,shutdown = false){
    
    var packet = []
    packet[0x00]   = 0x00;
    packet[0x01]   = 0xD2;
    packet[0x02]   = zoneId;
    packet[0x03]   = 0x00;
    packet[0x04]   = 0x08;

    for(var iIdx = 0; iIdx < vLedPositions.length; iIdx++)
    {

        
        var iX = vLedPositions[zoneId/16][0];
        var iY = vLedPositions[zoneId/16][1];
    
        var color;
        if(shutdown){
            color = hexToRgb(shutdownColor)
        }else if (LightingMode == "Forced") {
            color = hexToRgb(forcedColor)
        }else{
            color = device.color(iX, iY);
        }
        packet[0x05+iIdx*3] = color[0];
        packet[0x06+iIdx*3] = color[1];
        packet[0x07+iIdx*3] = color[2];
     }
     packet[11] = 0x64;

    device.write(packet, 65);
    device.pause(1);
}

export function Render() {
    sendColors(0);
    sendColors(16);

    if(savedDpi1 != dpi1 && DpiControl){
        setDpi(dpi1)
    }
}


